import React, {Component} from 'react';
import {connect} from 'react-redux';
import {fetchFoods} from '../../store/actions/foods'
import SearchBar from '../../components/PlanAlimenticio/SearchBar'

class PlanAlimenticio extends Component{
  render(){
    const {foods}=this.props
    //styles
    const tableStyle = {
      borderCollapse: 'collapse',
      width: '50%'
    }
    const dataStyle = {
      border: '1px solid #dddddd',
      textAlign: 'left',
      padding: '8px',
    }
    const headingsStyle = {
      backgroundColor: '#dddddd',
      width: '100%'
    }


    return(
      <div>
        <SearchBar/>
          {foods.map(function(food, key){
            return <div key={key}>
                      <table style={tableStyle}>
                        <tr style={headingsStyle}>
                          <th>Nombre</th>
                          <th>Calorias</th>
                          <th>Proteinas</th>
                          <th>Carbohidratos</th>
                          <th>Grasas</th>
                        </tr>
                        <tr>
                          <td>{food.foodName}</td>
                          <td>{food.calories_kcal}</td>
                          <td>{food.protein_g}</td>
                          <td>{food.carbs_g}</td>
                          <td>{food.fat_g}</td>
                        </tr>
                      </table>
                   </div>
          })}
      </div>
      );
  }}


function mapStateToProps(state){
  return{
    foods: state.foods,
    currentUserId: state.currentUser.user.id
  };
};


export default connect(mapStateToProps, {fetchFoods})(PlanAlimenticio);
